import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@mui/icons-material/Sort';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const useStyles = makeStyles((theme) => ({
    main: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        fontFamily: 'Nunito',
    },

    appbar: {
        background : 'none',
        fontFamily: 'Nunito',

    },

    appbarWrapper: {
        width: '80%',
        margin: '0 auto',
    },

    appbarTitle: {
        flexGrow: '1',
    },

    titlecolor: {
        color: '#C20C27',
    },

    bodycolor: {
        color: '#C20C27',
    },

    container: {
        textAlign: 'center',
    },

    appBody: {
        fontSize: '4.5rem',
       color: '#fff',
   },

    icon: {
        color: '#fff',
        fontSize: '2rem',
    },

    downIcon: {
        fontSize: '5rem',
        color: '#C20C27',

    },
}));


export default function Header() {
    const classes = useStyles();
return (
    <div className={classes.main}>
        <AppBar className={classes.appbar} elevation={0}>
            <Toolbar className={classes.appbarWrapper}> 
                <h1 className={classes.appbarTitle} > Fibonacci<span className={classes.titlecolor}>DAO.</span> </h1>
                <IconButton>
                    <SortIcon className={classes.icon} />
                </IconButton>
            </Toolbar>
        </AppBar>
        <div className={classes.container}>
            <h1 className={classes.appBody}>
                Welcome to <br />  Fibonacci<span className={classes.titlecolor}>DAO.</span>
             </h1>
             <IconButton>
                <KeyboardArrowDownIcon className={classes.downIcon} />
             </IconButton>
        </div>
    </div>
    );
}
